import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import * as serviceWorker from './serviceWorker';
import { BrowserRouter ,Route,Switch,Redirect } from 'react-router-dom';
import Login from './pages/login/login';
import Crud from './pages/studentCrud/Crud';
import Reports from './pages/reports/';
import GroupCrud  from './pages/groupCrud';
import {AuthContextProvider } from './context/auth'
import {StudentContextProvider } from './context/students'
import {GroupContextProvider } from './context/group'
import GuardRoute from './components/guardRoute'
import Root from './components/root'
import 'react-vis/dist/style.css/'

const App =(
    <BrowserRouter>
        <AuthContextProvider>
        <StudentContextProvider>
     
            <Root>
            <Switch>
             <Route type="private" path="/App" component={Crud} />
             <Route type="public" path="/login" component={Login} />
            <Route type="public" path="/reports" component={Reports} />
            
                    </Switch>
            </Root>
    
        </StudentContextProvider>


        </AuthContextProvider>
    </BrowserRouter>
)

ReactDOM.render(App, document.getElementById('root'));


serviceWorker.unregister();
